import React from 'react'

function header({approvers, quorum}) {
    return(
    <div>
        <ul>
            <li>
            Approvers : {approvers }
            </li>
            <li>
                Quorum : {quorum}
            </li>
        </ul>
    </div>
    );
}

export default header;
